import { Collapse, createStyles, List, ListItem, ListItemText, ListSubheader, makeStyles, Theme } from '@material-ui/core'
import React from 'react'


const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            width: '100%',
            backgroundColor: '#340152',
        },
        nested: {
            color: 'white',
            paddingLeft: theme.spacing(4)
        },
    }),
)


function SkillsList() {
    const classes = useStyles()
    const [open, setOpen] = React.useState(true)

    const handleClick = () => {
        setOpen(!open);
    }

    return (
        <List
            component="nav"
            aria-labelledby="nested-list-subheader"
            subheader={
                <ListSubheader component="div" id="nested-list-subheader" color='inherit'>
                    Skills
                </ListSubheader>
            }
            className={classes.root}
        >


            <ListItem button onClick={handleClick}>
                <ListItemText primary="Programming languages"></ListItemText>
            </ListItem>


            <Collapse in={open} timeout="auto" unmountOnExit>


            </Collapse>

            <ListItem button className={classes.nested}>
                <ListItemText primary="Markup languages"></ListItemText>
            </ListItem>
            <ListItem button className={classes.nested}>
                <ListItemText primary="Architectural pattern"></ListItemText>
            </ListItem>
            <ListItem button className={classes.nested}>
                <ListItemText primary="Frameworks / API / tools"></ListItemText>
            </ListItem>
            <ListItem button className={classes.nested}>
                <ListItemText primary="Android related"></ListItemText>
            </ListItem>

        </List>
    )
}

export default SkillsList
